import './App.css';
import React from 'react';

function firstClick () {
  console.log('olá, sou botão 1')
}
function secondClick () {
  console.log('olá, sou botão 2')
}
function thirdClick () {
  console.log('olá, sou botão 3')
}

function App() {
  return (
    <>
    <button onClick={firstClick}>Botão 1</button>
    <button onClick={secondClick}>Botão 2</button>
    <button onClick={thirdClick}>Botão 3</button>
    </>
  );
}

export default App;
